"use strict";
({ params, imports }) => {
  const programEncounter = params.entity;
  const moment = imports.moment;
  const scheduleBuilder = new imports.rulesConfig.VisitScheduleBuilder({programEncounter});

  const condition11 = new imports.rulesConfig.RuleCondition({programEncounter}).when.valueInEncounter("556d0f33-fbe1-46b7-b982-c8588927adc0").defined.matches();

  if(condition11 ){
    const earliestDate = moment(programEncounter.encounterDateTime).add(15, 'days').toDate();
    const maxDate = moment(programEncounter.encounterDateTime).add(7, 'days').toDate();
    scheduleBuilder.add({name: "TB Study Followup", encounterType: "TB Study Followup", earliestDate, maxDate});  
}

  return scheduleBuilder.getAll();
};
